webpackJsonp([0xd85e8e6d15b8],{4289:function(n,a){n.exports={data:{markdownRemark:{html:'<h2>Network Utterance Environment</h2>\n<p>オープンソースのブログ/CMSシステムです。danmaq Webページも従来のテキストエディタによる手書きブログから2011/6/23より全面的にこのシステム上に移行しました。</p>\n<h2>特徴</h2>\n<ul>\n<li>XSLTを用いた非常に自由度の高いカスタム性のスキンが使用できます。</li>\n<li>ニコニコ動画風のタグシステムを実装。さらにタグを階層化することで、タグをそのまま「目次」代わりに利用できます。</li>\n<li>\n<p>疑似HTMLを使ったタグを記事中に埋め込むことで、記事の構成や見栄えをカスタマイズできます。</p>\n<h2>ダウンロード</h2>\n</li>\n</ul>\n<ul>\n<li><a href="http://nue.sourceforge.jp/">SOURCEFORGE.JPからダウンロードできます</a></li>\n<li><a href="http://svn.sourceforge.jp/svnroot/nue/">SVNリポジトリ(readonly)</a></li>\n<li><a href="legacy/README">README</a></li>\n<li><a href="legacy/HISTORY">更新履歴(Nightly build)</a>\n動作サンプルは現在停止中です。代わりに<a href="legacy/">danmaqlassicが事実上の動作サンプルとなっております</a>。</li>\n</ul>',frontmatter:{cover:null,date:"2011-06-01T15:00:00+09:00",strDate:"2011/6/1",title:"NUE - XSLで自由度の高いスキンが可能なブログ/CMSシステム"}}},pathContext:{path:"/ja/blog/2011/06/01-nue/",langKey:"ja"}}}});
